import request from '@/utils/request'

// 查询出库列表页
export const getWarehouseDetailPage = (params: any) => {
  return request({
    url: '/team_leader/page',
    method: 'get',
    params
  })
}


// 新增出库申请
export const submitWarehouseRequest = (params: any) => {
  return request({
    url: '/team_leader/set_equipment_outbound_request',
    method: 'post',
    data: { ...params }
  })
}


// 查看出库申请详细
export const queryOutboundDetailById = (params: any) => {
  return request({ 
    url: `/team_leader/select/${params.requestCode}`,
    method: 'get'
  })
}

//出库申请取消
export const cancelOutbound = (params: any) => {
  return request({
    url: '/team_leader/cancel_outbound_form',
    method: 'put' /*  */,
    data: { ...params }
  })
}



//出库申请取消
export const outbound = (params: any) => {
  return request({
    url: '/WarehouseManager/outbound',
    method: 'put' /*  */,
    data: { ...params }
  })
}


//出库申请驳回
export const refuseOutbound = (params: any) => {
  return request({
    url: '/section_chief/reviewedEquipmentRequest',
    method: 'put' /*  */,
    data: { ...params }
  })
}

//审核通过
export const auditOutbound = (params: any) => {
  return request({
    url: '/section_chief/reviewedEquipmentRequest',
    method: 'put' /*  */,
    data: { ...params }
  })
}

//获取各个状态数量
export const getoutboundStatusListBy = (params: any) => {
  return request({
    url: '/team_leader/statistics',
    method: 'get' /*  */
  })
}


// 查询出库列表页
export const getDevicePage = (params: any) => {
  return request({
    url: '/WarehouseManager/page',
    method: 'get',
    params
  })
}

// 查看出库申请详细
export const queryDeviceById = (params: any) => {
  return request({ 
    url: `/WarehouseManager/deviceGetById/${params.deviceId}`,
    method: 'get'
  })
}

//财务人员提交采购单的审核
export const InboundById = (params: any) => {
  return request({
    url: '/WarehouseManager/inbound',
    method: 'put' /*  */,
    data: { ...params }
  })
}
